import React, { useEffect } from "react";
import Sidebar from "../Shared/Sidebar";
import { Outlet, useNavigate } from "react-router-dom";

const AdminLayout = () => {
  const navigate = useNavigate(); // Initialize the navigate hook

  const adminLinks = [
    { name: "Home", path: "/" },
    { name: "Company List", path: "/admin/company-list" },
    { name: "Communication Method", path: "/admin/communication-method" },
  ];

  // Automatically redirect to the "Company List" page on component mount
  useEffect(() => {
    navigate("/admin/company-list");
  }, [navigate]);

  return (
    <div className="layout">
      <Sidebar links={adminLinks} title="Admin Options" />
      <div className="content">
        <Outlet />
      </div>
    </div>
  );
};

export default AdminLayout;
